import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../App.css';
import { useSelector, useDispatch } from 'react-redux';
import { listPuppies } from '../actions/puppyActions';
import { Jumbotron, Card, Row, Col, Container, CardDeck, CardGroup } from 'react-bootstrap';

const HomePage = () => {
return(
<div className="HomeContainer">
  <div className="Page">
    <div className="HomePage">
<Jumbotron fluid>
  <Container>
    <h1>Welcome to Home Raised Cairns</h1>
    <br />
    <p id="Title">
      AKC Registarable Carin Terriers - Not just from a home, not from a kennel
    </p>
  </Container>
</Jumbotron>

<div> 

  So if you see a puppy avaliable, he or she is still available but i do 
  require a phone interview to get to know you and your situiation better first. 


   Or if you know you want a puppy from home raised cairns and interesteed in putting down a  depsoit </div>
</div>
</div>
</div>
)
}
export default HomePage;
